ry video was directed by Simon West  who later went on to make Hollywood blockbusters such as Con Air, Lara Croft  Tomb Raider and The Expendables 2.  The video passed the 1bn YouTube views milestone on 28 July 2021.\n\nSubscribe to the official Rick Astley YouTube channel: https://RickAstley.lnk.to/YTSubID\n\nFollow Rick Astley:\nFacebook: https://RickAstley.lnk.to/FBFollowID \nTwitter: https://RickAstley.lnk.to/TwitterID \nInstagram: https://RickAstley.lnk.to/InstagramID \nWebsite: https://RickAstley.lnk.to/storeID \nTikTok: https://RickAstley.lnk.to/TikTokID\n\nListen to Rick Astley:\nSpotify: https://RickAstley.lnk.to/SpotifyID \nApple Music: https://RickAstley.lnk.to/AppleMusicID \nAmazon Music: https://RickAstley.lnk.to/AmazonMusicID \nDeezer: https://RickAstley.lnk.to/DeezerID \n\nLyrics:\nWere no strangers to love\nYou know the rules and so do I\nA full commitments what Im thinking of\nYou wouldnt get this from any other guy\n\nI just wanna tell you how Im feeling\nGotta make you understand\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\nWeve known each other for so long\nYour hearts been aching but youre too shy to say it\nInside we both know whats been going on\nWe know the game and were gonna play it\n\nAnd if you ask me how Im feeling\nDont tell me youre too blind to see\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo","commandRuns":[{"startIndex":180,"length":16,"onTap":{"innertubeCommand":{"clickTrackingParams":"CIMDENzXBBggIhMIpbWEoMDajwMVy5hWAR1Xdy_nygEEu8lNKQ==","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/rickastleynever","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/ yID \nApple Music: https://RickAstley.lnk.to/AppleMusicID \nAmazon Music: https://RickAstley.lnk.to/AmazonMusicID \nDeezer: https://RickAstley.lnk.to/DeezerID \n\nLyrics:\nWere no strangers to love\nYou know the rules and so do I\nA full commitments what Im thinking of\nYou wouldnt get this from any other guy\n\nI just wanna tell you how Im feeling\nGotta make you understand\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\nWeve known each other for so long\nYour hearts been aching but youre too shy to say it\nInside we both know whats been going on\nWe know the game and were gonna play it\n\nAnd if you ask me how Im feeling\nDont tell me youre too blind to see\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo","commandRuns":[{"startIndex":180,"length":16,"onTap":{"innertubeCommand":{"clickTrackingParams":"CKYBENzXBBgmIhMIpbWEoMDajwMVy5hWAR1Xdy_nygEEu8lNKQ==","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/rickastleynever","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUTCg9yaWNrYXN0bGV5bmV2ZXIYAQ%3D%3D"}}},"loggingDirectives":{"trackingParams":"CKYBENzXBBgmIhMIpbWEoMDajwMVy5hWAR1Xdy_n"}},{"startIndex":197,"length":33,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBYQ040EGAYiEwiltYSgwNqPAxXLmFYBHVd3L-dIxLuBrb2YjoZ1ygEEu8lNKQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbWFkXzVhOUVSYzlGYm52Qk95WXlYa2VSVWpSZ3xBQ3Jtc0tudjcxQkhLR0lTcDZNLUpaeWpmdUZ0ZUxMa3o1enlUZ3BBOWVjcmpaUU0tZXVBYkF3ajdLdG13SjZFeE1GYk4zNllMU05yYURQSEc5NXFYcGpKZlZLdGZ0cmxRYXZHN
